import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      hbcUsers: []
    }
  }

  componentDidMount() {
    fetch('https://hbc-frontend-challenge.hbccommon.private.hbc.com/coffee-week/users')
        .then( response => response.json())
        .then( users => this.setState({ hbcUsers: users }));
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and lol.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
